import React from 'react'
import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';


const SignInCard = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
`;

const FormLabel = styled.label`
    margin-top: 15px;
    border: 1px solid black;
    border-radius: 15px;
`;


function SignIn() {
    return (
        <div style={{height: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center'}}>
            <form  >
                <SignInCard>
                    <p style={{fontSize: '21px', marginBottom: '15px'}}>Sign In</p>
                        <FormLabel>
                            <FontAwesomeIcon icon='user' />
                            <input type='email' placeholder='Enter your email' style={{padding: '5px 8px', border: 'none'}}/>
                        </FormLabel>
                        <FormLabel>
                            <FontAwesomeIcon icon='lock' />
                            <input type='password' placeholder='Password' style={{padding: '3px 8px', border: 'none'}}/>
                        </FormLabel>
                </SignInCard>
            </form>
        </div>
    )
}

export default SignIn
